import React from 'react';
import {useState, useEffect} from 'react';
import './App.css';

function App() {
  const [todos, setTodos] = useState([
    {
      text: 'learn about react', 
      isCompleted: false
    },
    {
      text: 'meet friend for lunch', 
      isCompleted: false
    },
    {
      text: 'build really cool todo app', 
      isCompleted: false
    },
  ])
}

export default App;
